import React, { useState } from 'react';

export default function Navbar({ onSignupClick }) {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-gray-900 text-white px-6 py-4">
      <div className="flex justify-between items-center">
        <h1 className="text-4xl font-bold">CryptoInvest</h1>

        {/* Hamburger Icon */}
        <button
          className="md:hidden text-white focus:outline-none"
          onClick={() => setIsOpen(!isOpen)}
        >
          â˜°
        </button>

        {/* Desktop Menu */}
        <ul className="hidden md:flex items-center space-x-6">
          <li><a href="#about" className="hover:text-indigo-400">About Us</a></li>
          <li><a href="#features" className="hover:text-indigo-400">Features</a></li>
          <li><a href="#login" className="hover:text-indigo-400">Login</a></li>
          <li>
            <button
              onClick={onSignupClick}
              className="px-4 py-2 bg-indigo-600 rounded hover:bg-indigo-700 transition"
            >
              Sign Up
            </button>
          </li>
        </ul>
      </div>

      {/* Mobile Menu */}
      {isOpen && (
        <ul className="flex flex-col mt-4 space-y-2 md:hidden">
          <li><a href="#about" className="hover:text-indigo-400">About Us</a></li>
          <li><a href="#features" className="hover:text-indigo-400">Features</a></li>
          <li><a href="#login" className="hover:text-indigo-400">Login</a></li>
          <li>
            <button
              onClick={onSignupClick}
              className="px-4 py-2 bg-indigo-600 rounded hover:bg-indigo-700 transition"
            >
              Sign Up
            </button>
          </li>
        </ul>
      )}
    </nav>
  );
}
